class Solution {
public:
    int maxOperations(string s) {
        int curs= 0;
        int lastind = -1;
        int res = 0;
        s.push_back('1');
        for(int i=0;i<s.size();i++){
            if(s[i]=='1'){
                if(lastind != i-1){
                    res += curs;
                }
                lastind = i;
                curs++;
            }
        }
        return res;
    }
};
